import './App.css';
import {Route, Routes, BrowserRouter} from 'react-router-dom'
import Home from './components/Home';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      {this.props.children}
      <Route element={ <Home/> } path="/"/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
